                auto g_xxxxzzz_0 = primBuffer.data(goff + 36 * idx + 9);

                auto g_xxxyyyy_0 = primBuffer.data(goff + 36 * idx + 10);

                auto g_xxxyyyz_0 = primBuffer.data(goff + 36 * idx + 11);

                auto g_xxxyyzz_0 = primBuffer.data(goff + 36 * idx + 12);

                auto g_xxxyzzz_0 = primBuffer.data(goff + 36 * idx + 13);

                auto g_xxxzzzz_0 = primBuffer.data(goff + 36 * idx + 14);

