                    g_z_xzzzzzz[k] = pbz * g10_0_xzzzzzz[k] + fr * g11_0_xzzzzzz[k] + 6.0 * f2t * gk_0_xzzzzz[k];

                    g_z_yyyyyyy[k] = pbz * g10_0_yyyyyyy[k] + fr * g11_0_yyyyyyy[k];

                    g_z_yyyyyyz[k] = pbz * g10_0_yyyyyyz[k] + fr * g11_0_yyyyyyz[k] + f2t * gk_0_yyyyyy[k];

                    g_z_yyyyyzz[k] = pbz * g10_0_yyyyyzz[k] + fr * g11_0_yyyyyzz[k] + 2.0 * f2t * gk_0_yyyyyz[k];

                    g_z_yyyyzzz[k] = pbz * g10_0_yyyyzzz[k] + fr * g11_0_yyyyzzz[k] + 3.0 * f2t * gk_0_yyyyzz[k];

                    g_z_yyyzzzz[k] = pbz * g10_0_yyyzzzz[k] + fr * g11_0_yyyzzzz[k] + 4.0 * f2t * gk_0_yyyzzz[k];

                    g_z_yyzzzzz[k] = pbz * g10_0_yyzzzzz[k] + fr * g11_0_yyzzzzz[k] + 5.0 * f2t * gk_0_yyzzzz[k];

                    g_z_yzzzzzz[k] = pbz * g10_0_yzzzzzz[k] + fr * g11_0_yzzzzzz[k] + 6.0 * f2t * gk_0_yzzzzz[k];

                    g_z_zzzzzzz[k] = pbz * g10_0_zzzzzzz[k] + fr * g11_0_zzzzzzz[k] + 7.0 * f2t * gk_0_zzzzzz[k];
