                auto gk_xy_xyyzzz = primBuffer.data(gkoff + 168 * idx + 46);

                auto gk_xy_xyzzzz = primBuffer.data(gkoff + 168 * idx + 47);

                auto gk_xy_xzzzzz = primBuffer.data(gkoff + 168 * idx + 48);

