            auto g10off = genfunc::findTripleIndex(recIndexes, recPattern,
                                                   {6, 4, i});

            auto g11off = genfunc::findTripleIndex(recIndexes, recPattern,
                                                   {6, 4, i + 1});

            auto g20off = genfunc::findTripleIndex(recIndexes, recPattern,
                                                   {5, 4, i});

